WITH auszug AS (
  INSERT INTO agi_oereb_azg_ann.katasterauszgnnex_auszug 
  (
    logooerebk,
    logobund,
    logokanton,
    allgemeineinformation_de,
    grundlagedaten_de
  )
  SELECT 
    decode('', 'base64') AS logooerebk,
    decode('', 'base64') AS logobund,
    decode('', 'base64') AS logokanton,
    'Der Inhalt des OREB-Katasters wird als bekannt vorausgesetzt. Der Kanton Solothurn ist fur die Genauigkeit und Verlasslichkeit der gesetzgebenden Dokumente in elektronischer Form nicht haftbar. Der Auszug hat rein informativen Charakter und begrundet insbesondere keine Rechte und Pflichten. Rechtsverbindlich sind diejenigen Dokumente, welche rechtskraftig verabschiedet oder veroffentlicht worden sind. Mit der Beglaubigung des Auszugs wird die Ubereinstimmung dieses mit dem Kataster zum Zeitpunkt der Auszugserstellung bestatigt.' AS allgemeineinformation_de,
     'Daten der amtlichen Vermessung' AS grundlagedaten_de -- Whitespace need b/c of gretls non robust utf8 check.
  RETURNING *
)
,
kvs AS (
  INSERT INTO agi_oereb_azg_ann.katasterauszgnnex_amt
  (
    t_seq,
    aname_de,
    amtimweb,
    strasse,
    hausnr,
    plz,
    ort,
    katasterauszgnnex_szug_katasterfuehrendestelle
  )
  SELECT
    0 AS t_seq,
    'Amt fr Geoinformation' AS aname_de,
    'http://agi.so.ch' AS amtimweb,
    'Rtistrasse' AS strasse,
    '4' AS hausnr,
    '4501' AS plz,
    'Solothurn' AS ort,
    auszug.t_id AS katasterauszgnnex_szug_katasterfuehrendestelle
  FROM
    auszug
  RETURNING *
)
,
haftungsausschuss AS (
  INSERT INTO agi_oereb_azg_ann.katasterauszgnnex_haftungsausschluss
  (
    t_seq,
    titel_de,
    inhalt_de,
    katasterauszgnnex_szug_haftungsausschluss
  )
  SELECT
    0 AS t_seq,
    'Haftausschluss Kataster der belasteten Standorte' AS titel_de,
    'Ich bin ein Beispiel: Der Kataster der belasteten Standorte (KbS) wurde anhand der vom Bundesamt fur Umwelt BAFU festgelegten Kriterien erstellt und wird fortwahrend aufgrund neuer Erkenntnisse (z.B. Untersuchungen) aktualisiert. Die im KbS eingetragenen Flachen konnen vom tatsachlichen Ausmass der Belastung abweichen. Erscheint ein Grundstuck nicht im KbS, besteht keine absolute Gewahr, dass das Areal frei von jeglichen Abfall- oder Schadstoffbelastungen ist. Bahnbetrieblich, militarisch und fur die Luftfahrt genutzte Standorte liegen im Zustandigkeitsbereich des Bundes und sind im vorliegenden kantonalen KbS nur teilweise dargestellt. Fur weitere Informationen wenden Sie sich bitte an die kantonale Altlastenfachstelle: afu@nw.ch' AS inhalt_de,
    auszug.t_id AS katasterauszgnnex_szug_haftungsausschluss
  FROM
    auszug
  RETURNING *
)
,
glossar AS (
  INSERT INTO agi_oereb_azg_ann.katasterauszgnnex_glossar
  (
    t_seq,
    titel_de,
    inhalt_de,
    katasterauszgnnex_szug_glossar
  )
  SELECT
    0 AS t_seq,
    'foo' AS titel_de,
    'bar' AS inhalt_de,
    auszug.t_id AS katasterauszgnnex_szug_glossar
  FROM
    auszug
  UNION ALL
  SELECT
    1 AS t_seq,
    'bar' AS titel_de,
    'foo' AS inhalt_de,
    auszug.t_id AS katasterauszgnnex_szug_glossar
  FROM
    auszug 
  RETURNING *
)
SELECT
  *
FROM
  glossar
;

