  decode('', 'base64') AS logo,
  gemeinden.bfsnr::int,
  'Gemeindename'||gemeinden.bfsnr AS aname_de,
  'http://gemeindeimweb.ch' AS amtimweb,
  'Fubarstrasse' AS strasse,
  '0' AS hausnr,
  '9999' AS plz,
  'Entenhausen' AS ort
FROM
  gemeinden
;

